{{
function formatB() {
	let n = Current_month_data.data[0]["count_currentmonth"]
	if (n > 999999999){
		return (n / 1000000000).toFixed(2) + "B";
	}
  else if(n > 999999){
    return (n/1000000).toFixed(2) + "M";
	}
	else if(n > 999){
    return (n/1000).toFixed(2) + "K";
	}
	else{
		return n;
	}
}()
}}

{{
function changepercent() {
	let n = ((Current_month_data.data[0]["count_currentmonth"]-Last_year_month.data[0]["count_prevyearmonth"])/(Last_year_month.data[0]["count_prevyearmonth"])*100)
	if (n > 0){
		return (n).toFixed(2) + "% more than last yearmonth";
	}
  else if(n < 0){
    return (n).toFixed(2) + "% less than last yearmonth";
	}
}()
}}

